userDefinedLinkHintCss:
#vomnibar .vomnibarSearchArea { padding: 2px; }
#vomnibar ul { margin: 1px 0; }

* { font-family: Courier, Courier13, Courier20, monospace, sans-serif !important; }

div > .vimiumHintMarker {
/* linkhint boxes */
background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#FFF785),
  color-stop(100%,#FFC542));
border: 1px solid #E3BE23;
}

div > .vimiumHintMarker span {
/* linkhint text */
color: black;
font-weight: bold;
font-size: 12px;
}

div > .vimiumHintMarker > .matchingCharacter {
}

#vomnibarInput { font: 20px Courier20 !important; }
